fn legacy_cmd_id_input(
    source_transaction: HexBinary,
    source_event_index: Uint64,
    chain_id: Uint256,
) -> String {
    let data = [
        source_transaction.as_slice(),
        &source_event_index.to_le_bytes(),
        chain_id
            .to_be_bytes()
            .iter()
            .skip_while(|x| *x == &0u8)
            .copied()
            .collect::<Vec<u8>>()
            .as_slice(),
    ]
    .concat();

    unsafe { String::from_utf8_unchecked(data) }
}

