pub fn threshold() -> Threshold {
    let numerator: nonempty::Uint64 = Uint64::from(3u8).try_into().unwrap();
    let denominator: nonempty::Uint64 = Uint64::from(5u8).try_into().unwrap();
    (numerator, denominator).try_into().unwrap()
}

